import fetch from "isomorphic-unfetch";
import {useState}from "react";
import Layout from "../components/Layout";
import Case from "../components/Case";



function Cases() {
  const [state, setState] =useState ({cases: [], isLoading: false});
// Making an API call to cases-api


  return (
    <Layout title="Cases | Convid Anchor">
      <h1>Cases Page</h1>
      <div className="cases">
            {state.cases.map((item, key) => {
                return <Case key={key} caseData={item}/>;
            })}
        </div>
    </Layout>
  );
}

export default Cases;

// Get Cases
const Case_API = "http://localhost:5000";
async function getCases(update) {
  const response = fetch(CASE_API);
  const data = await response.json();
await update(data)

}
